import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import InputBase from '@material-ui/core/InputBase';
import './PrivateHeader.css'

const styles = {
  input: {
    marginLeft: 8,
    flex: 1,
    backgroundColor: "white",
    paddingLeft: 10,
    paddingRight: 30
  }
};

class PrivateHeader extends Component {

  render() {
    const { classes } = this.props;

    return (
      <div className="private-header">

        <div className="page-links">
          <h6>
            <span className="page-link">HOME</span>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <span className="page-link">FAVOURITES</span>
          </h6>
        </div>

        <div className="header-content">
          <h1 className="company-name">The Beer Bank</h1>

          <p>Find your favourite beer here</p>
            <InputBase className={classes.input} placeholder="Search for beer name" />
        </div>

        <div >
        </div>

      </div>
    );
  }
}

PrivateHeader.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(PrivateHeader);
